    [],nt"num_tags": 4,nt"name": "red-rock-lakes-national-wildlife-refuge-narrative-report-may-to-august-1957",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Red Rock Lakes
    National Wildlife Refuge outlines Refuge accomplishments from May to August 1957.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, mammals, raptors, and fish- is
    also covered. The Refuge development and maintenance section discusses physical
    developments. Resource management is outlined; topics include grazing, haying, and
    fur harvesting. A progress report on field investigations and applied research is
    also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, and fishing. Items of interest, N-R
    forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
